    string public symbol="SLC";
    uint256 private _cap;

    constructor (string memory _name,string memory _symbol,uint8 _decimals) public {
        decimals = _decimals;
        name = _name;
        symbol = _symbol;
        _cap = 2000000000000000000000000;
    }

    /**
     * @return the cap for the token minting.
     */
